import React from 'react';
import giticon from '../assets/images/giticon.svg';

function Puppet2ansible(){
    return(
        <div className="card">
            <h3>Puppet to Ansible compiler</h3>
            <h5><br></br>Comming Soon</h5>
            <a href="/project" target="_blank" rel="noopener noreferrer">
             <img className="link" src={giticon} alt="img" /></a>
        </div>
    );
}

export default Puppet2ansible;
